import React, { useState } from 'react';
import './Navbar.css';

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };

  return (
    <div className={`navbar ${isOpen ? 'navbar-open' : ''}`}>
      <img src="/assets/image5.png" alt="Logo" className="image5" />
      <div className={`frame222 ${isOpen ? 'frame222-open' : ''}`}>
        all 0.3s ease
        <div className="formkit-linkedin">
          <img src="/assets/linkedin-logo.png" alt="LinkedIn" className="vector-linkedin" />
        </div>
        <div className="devicon-twitter">
          <img src="/assets/twitter-logo.png" alt="Twitter" className="vector-twitter" />
        </div>
        <div className="basil-instagram-solid">
          <img src="/assets/instagram-logo.png" alt="Instagram" className="vector-instagram" />
          <img src="/assets/instagram2-logo.png" alt="Instagram" className="vector-instagram-2" />
        </div>
      </div>
      <div className={`frame221 ${isOpen ? 'frame221-open' : ''}`}>
        <div className="text-products">Products</div>
        <div className="text-build-at-soaron">Build at Soaron</div>
        <div className="text-contact-us">Contact Us</div>
      </div>
      <div className="frame219" onClick={toggleMenu}>
        <div className="frame220">
          <div className="text-menu">Menu</div>
          <div className={`frame218 ${isOpen ? 'frame218-open' : ''}`}>
            <div className={`line98 ${isOpen ? 'line98-open' : ''}`}>
            </div>
            <div className={`line97 ${isOpen ? 'line97-open' : ''}`}>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
